import React, { useState, useEffect } from "react";
import Bird from "./Bird";
import Empty from "./Empty";

const ObjectCreatorBird = React.memo(({ objectIndex, onCollision }) => {
    const [isPaused, setIsPaused] = useState(false);

    useEffect(() => {
        if (objectIndex >= 0 && objectIndex <= 10) {
            setIsPaused(true);
            setTimeout(() => {
                setIsPaused(false);
            }, 10000);
            onCollision();
        }
    }, [objectIndex, onCollision]);

    const componentMap = {
        empty: {
            min: 11,
            max: 99,
            component: <Empty />
        },
        bird: {
            min: 0,
            max: 10,
            component: <Bird />
        }
    };

    for (const key in componentMap) {
        const { min, max, component } = componentMap[key];
        if (objectIndex >= min && objectIndex <= max) {
            return (
                <div>
                    {isPaused ? (
                        <div>
                            <Empty />
                        </div>
                    ) : (
                        component
                    )}
                </div>
            );
        }
    }
});

export default ObjectCreatorBird;
